import React, {Component}  from 'react';
import x_image from '../images/1.png'; 
import o_image from '../images/0.png'; 

class  Cell extends Component {

render(){
  return(
    <div className="game_cell">
      <img className="logo" src={x_image} alt="x_image" />
      {/*<img className="logo" src={o_image} alt="o_image" />*/}
    </div>

  );
  }

}
export default Cell;
